4674	4768	vacancies	2	{"id":2,"status":"published","date_created":"2025-10-30T15:52:08.473Z","date_updated":"2025-10-30T16:00:46.972Z","source_url":"https://www.linkedin.com/jobs/view/4332442558/","title":"Senior Python Developer","job_description":"Senior Backend Engineer (Django)  Remote Europe | 100k + Equity\\n\\n\\nFoxley Talent's client is a fast growing creative AI startup on a mission to make visual creation effortless. Their web and mobile apps with Django at their core use cutting edge generative technology to help millions of users produce professional quality imagery in seconds and empowering creators, small businesses, and global brands alike.\\n\\n\\nWith hundreds of millions of downloads and billions of assets processed annually, the platform operates at massive scale, blending world class design with serious engineering. They are profitable, expanding quickly, and now hiring a Senior Backend Engineer with expertise in Django to join their (almost fully remote) European team.\\n\\n\\nThe Role\\n\\nAs a Senior Backend Engineer, youll help design and deliver new features for a high volume, user centric platform. Youll work closely with other engineers, product teams, and data specialists to keep the system fast, reliable, and intuitive.\\n\\n\\nYoull own your work end to end: from architecture and implementation to monitoring and optimisation. Expect to iterate quickly, release often, and see your code impact millions of users around the world.\\n\\n\\nWhat Youll Be Working On\\n\\n    Build and maintain scalable backend services using Python, Django, and Django REST Framework\\n    Collaborate with frontend teams using TypeScript, React, and GraphQL to design efficient APIs\\n    Optimise and refactor existing endpoints to reduce latency and support large-scale traffic\\n    Design and evolve relational database schemas (PostgreSQL) and manage migrations with minimal downtime\\n    Monitor performance and reliability using tools such as Datadog and Sentry\\n    Ship frequently in an agile, experimentation driven environment\\n    Contribute to architectural discussions, tooling improvements, and developer experience\\n\\n\\nKey Requirements\\n\\n    5+ years of experience building backend systems with Python and Django\\n    Solid understanding of relational databases and query optimisation at scale (100GB+)\\n    Experienced in designing and documenting APIs for internal and external use\\n    Strong sense of ownership. It helps if you care deeply about quality, reliability, and speed!\\n    Pragmatic and product focused. Valuing iteration and simplicity over \\"over engineering\\"\\n    Fluent in English and comfortable working remotely across time zones\\n\\n\\nNice to haves\\n\\n    Familiarity with GCP or similar cloud platforms\\n    Exposure to large scale consumer or creative tech products\\n    Experience working closely with design driven or AI focused teams\\n\\n\\nThe Offer\\n\\n    100k base salary (flexible for exceptional profiles) this will be paid through an employer of record service like Deel\\n    Equity package / stock options\\n    Fully remote across Europe, with paid travel for quarterly team meetings\\n    30 days paid leave + local public holidays\\n    Annual learning & development budget\\n    Home office setup budget or co-working allowance\\n    Private health coverage and wellness support\\n\\n\\nHow To Apply\\n\\nApply now through Foxley Talent to find out more about this new opportunity. Send your latest CV and reasons for your interest in the role to hello@foxleytalent.com and we will review your application.\\n\\n\\nPlease note, this role is ONLY open to those currently based in Europe and no applications from residents outside of this region will be considered.\\n\\nThe company is not offering visa sponsorship or relocation.\\n\\nPlease only apply if you are in the location specified.","job_poster":"Foxley Talent","import_source":"linkedin"}	{"job_poster":"Foxley Talent","date_updated":"2025-10-30T16:00:46.972Z"}	\N	\N
