1561	1614	application_questions	073c5b04-8c09-46d5-939a-1ed666898fe0	{"id":"073c5b04-8c09-46d5-939a-1ed666898fe0","sort":null,"date_created":"2025-10-20T12:33:01.867Z","date_updated":"2025-10-20T12:58:39.306Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.","title":"Python backend building experience"}	{"answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.","date_updated":"2025-10-20T12:58:39.306Z"}	\N	\N
