1562	1615	application_questions	073c5b04-8c09-46d5-939a-1ed666898fe0	{"id":"073c5b04-8c09-46d5-939a-1ed666898fe0","sort":null,"date_created":"2025-10-20T12:33:01.867Z","date_updated":"2025-10-20T12:58:55.069Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.","title":"Python backend building experience"}	{"answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.","date_updated":"2025-10-20T12:58:55.069Z"}	\N	\N
1563	1616	application_questions	073c5b04-8c09-46d5-939a-1ed666898fe0	{"id":"073c5b04-8c09-46d5-939a-1ed666898fe0","sort":null,"date_created":"2025-10-20T12:33:01.867Z","date_updated":"2025-10-20T13:00:43.795Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, filtering, field-based filtering (returning only certain fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.","title":"Python backend building experience"}	{"answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, filtering, field-based filtering (returning only certain fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.","date_updated":"2025-10-20T13:00:43.795Z"}	\N	\N
1564	1617	application_questions	073c5b04-8c09-46d5-939a-1ed666898fe0	{"id":"073c5b04-8c09-46d5-939a-1ed666898fe0","sort":null,"date_created":"2025-10-20T12:33:01.867Z","date_updated":"2025-10-20T13:04:46.380Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, filtering, field-based filtering (returning only certain fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nWeasyPrint","title":"Python backend building experience"}	{"answer":"At my last employer, Chipta, I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, filtering, field-based filtering (returning only certain fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nWeasyPrint","date_updated":"2025-10-20T13:04:46.380Z"}	\N	\N
