1611	1664	application_questions	48a0e21c-ec0d-48d1-97b7-6cbbd5b7cf48	{"id":"48a0e21c-ec0d-48d1-97b7-6cbbd5b7cf48","sort":null,"date_created":"2025-10-20T13:49:08.162Z","date_updated":"2025-10-20T14:16:45.338Z","question":"Have you built or worked on systems that manage a lot of structured information or documents (e.g., internal platforms, CRMs, audit systems, or similar)? *\\n\\n- Describe what the system did and how you contributed.\\n- What kind of data or documents were handled?\\n- How did you design the backend (APIs, database, integrations, etc.)?\\n- (Optional) Did you add any AI-powered or automation features using Python?","answer":"At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.","title":"Data management system experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.","date_updated":"2025-10-20T14:16:45.338Z"}	\N	\N
1612	1665	application_questions	48a0e21c-ec0d-48d1-97b7-6cbbd5b7cf48	{"id":"48a0e21c-ec0d-48d1-97b7-6cbbd5b7cf48","sort":null,"date_created":"2025-10-20T13:49:08.162Z","date_updated":"2025-10-20T14:20:38.488Z","question":"Have you built or worked on systems that manage a lot of structured information or documents (e.g., internal platforms, CRMs, audit systems, or similar)? *\\n\\n- Describe what the system did and how you contributed.\\n- What kind of data or documents were handled?\\n- How did you design the backend (APIs, database, integrations, etc.)?\\n- (Optional) Did you add any AI-powered or automation features using Python?","answer":"At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.\\n\\nI imported all structured data into the MariaDB database. Then I created records in Elasticsearch with all the data that should be search-able, with a reference to the complete data in the database. In this way I could use Elasticsearch to efficiently find desired record, and when found, you can look up the complete info from the database.","title":"Data management system experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.\\n\\nI imported all structured data into the MariaDB database. Then I created records in Elasticsearch with all the data that should be search-able, with a reference to the complete data in the database. In this way I could use Elasticsearch to efficiently find desired record, and when found, you can look up the complete info from the database.","date_updated":"2025-10-20T14:20:38.488Z"}	\N	\N
1613	1666	application_questions	48a0e21c-ec0d-48d1-97b7-6cbbd5b7cf48	{"id":"48a0e21c-ec0d-48d1-97b7-6cbbd5b7cf48","sort":null,"date_created":"2025-10-20T13:49:08.162Z","date_updated":"2025-10-20T14:23:38.115Z","question":"Have you built or worked on systems that manage a lot of structured information or documents (e.g., internal platforms, CRMs, audit systems, or similar)? *\\n\\n- Describe what the system did and how you contributed.\\n- What kind of data or documents were handled?\\n- How did you design the backend (APIs, database, integrations, etc.)?\\n- (Optional) Did you add any AI-powered or automation features using Python?","answer":"At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.\\n\\nI imported all structured data into the MariaDB database. Then I created records in Elasticsearch with all the data that should be search-able, with a reference to the complete data in the database. In this way I could use Elasticsearch to efficiently find the desired record, and when found, fetch the complete info from the database.","title":"Data management system experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.\\n\\nI imported all structured data into the MariaDB database. Then I created records in Elasticsearch with all the data that should be search-able, with a reference to the complete data in the database. In this way I could use Elasticsearch to efficiently find the desired record, and when found, fetch the complete info from the database.","date_updated":"2025-10-20T14:23:38.115Z"}	\N	\N
