1618	1671	application_questions	c82ff97a-0f9e-4706-93b3-4eccc16c6127	{"id":"c82ff97a-0f9e-4706-93b3-4eccc16c6127","sort":3,"date_created":"2025-10-20T14:25:16.929Z","date_updated":"2025-10-20T14:46:44.968Z","question":"Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?","answer":"At Chipta, I led a project creating a scan app, to scan entrance tickets with the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs for the app and related the business logic.\\n\\nThe scan app would often be used by multiple people scanning at the entrance of an event. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data without any request overhead. This allowed me to create a custom protocol to send various data, like ticket scans, or undo's, or even adding more ticket data.","title":"Full-stack app building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta, I led a project creating a scan app, to scan entrance tickets with the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs for the app and related the business logic.\\n\\nThe scan app would often be used by multiple people scanning at the entrance of an event. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data without any request overhead. This allowed me to create a custom protocol to send various data, like ticket scans, or undo's, or even adding more ticket data.","date_updated":"2025-10-20T14:46:44.968Z"}	\N	\N
