1622	1675	application_questions	c82ff97a-0f9e-4706-93b3-4eccc16c6127	{"id":"c82ff97a-0f9e-4706-93b3-4eccc16c6127","sort":3,"date_created":"2025-10-20T14:25:16.929Z","date_updated":"2025-10-20T14:57:58.297Z","question":"Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?","answer":"At Chipta, I led a project creating a scan app, to scan and validate entrance tickets using the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and related the business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo's, or even adding more valid tickets.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events.","title":"Full-stack app building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta, I led a project creating a scan app, to scan and validate entrance tickets using the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and related the business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo's, or even adding more valid tickets.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events.","date_updated":"2025-10-20T14:57:58.297Z"}	\N	\N
1623	1677	application_questions	c82ff97a-0f9e-4706-93b3-4eccc16c6127	{"id":"c82ff97a-0f9e-4706-93b3-4eccc16c6127","sort":3,"date_created":"2025-10-20T14:25:16.929Z","date_updated":"2025-10-20T15:02:15.060Z","question":"Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?","answer":"At Chipta, I led a project creating a scan app, to scan and validate entrance tickets using the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and related the business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo's, or even adding more valid tickets.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it contributed to a 40% revenue increase in the 2 years after the release.","title":"Full-stack app building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta, I led a project creating a scan app, to scan and validate entrance tickets using the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and related the business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo's, or even adding more valid tickets.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it contributed to a 40% revenue increase in the 2 years after the release.","date_updated":"2025-10-20T15:02:15.060Z"}	\N	\N
1624	1678	application_questions	c82ff97a-0f9e-4706-93b3-4eccc16c6127	{"id":"c82ff97a-0f9e-4706-93b3-4eccc16c6127","sort":3,"date_created":"2025-10-20T14:25:16.929Z","date_updated":"2025-10-20T15:13:20.640Z","question":"Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?","answer":"At Chipta, I led a project creating a scan app, to scan and validate entrance tickets using the phone camera. I decided on using React Native, and guided a junior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and related the business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo's, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send it to the backend through the websocket connection. Then the backend would broadcast this scan to the other scan apps with open websocket connections. If an administrator updated a ticket in the backend, it would also be broadcasted over the websockets, so the scan apps would instantly be updated.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfu