 of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.","title":"Full-stack app building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta, I led a project creating a ticket scanning app, to scan and validate event entrance tickets, using the phone camera. I decided on using React Native, and guided a medior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and the related business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo-ing a scan, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send data about it to the backend over the websocket connection. Then the backend would broadcast this data to the other scan apps with open websocket connections. If an administrator updated a ticket in the backend, it would also be broadcasted over the websockets, so the scan apps would instantly be updated.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.","date_updated":"2025-10-20T15:16:41.220Z"}	\N	\N
1632	1686	application_questions	c82ff97a-0f9e-4706-93b3-4eccc16c6127	{"id":"c82ff97a-0f9e-4706-93b3-4eccc16c6127","sort":3,"date_created":"2025-10-20T14:25:16.929Z","date_updated":"2025-10-20T15:19:23.391Z","question":"Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?","answer":"At Chipta, I led a project creating a ticket scanning app, to scan and validate event entrance tickets, using the phone camera. I decided on using React Native, and guided a medior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and the related business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo-ing a scan, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send data about it to the backend over the websocket connection. Then the backend would broadcast this scan data to the other scan apps with open websocket connections, synchronizing the apps. Also, if an administrator would update the status of a visitor's ticket in the backend, it would also be broadcasted over the websockets.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.","title":"Full-stack app building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta, I led a project creating a ticket scanning app, to scan and validate event entrance tickets, using the phone camera. I decided on using React Native, and guided a medior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and the related business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo-ing a scan, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send data about it to the backend over the websocket connection. Then the backend would broadcast this scan data to the other scan apps with open websocket connections, synchronizing the apps. Also, if an administrator would update the status of a visitor's ticket in the backend, it would also be broadcasted over the websockets.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store. Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.","date_updated":"2025-10-20T15:19:23.391Z"}	\N	\N
1633	1687	application_questions	c82ff97a-0f9e-4706-93b3-4eccc16c6127	{"id":"c82ff97a-0f9e-4706-93b3-4eccc16c6127","sort":3,"date_created":"2025-10-20T14:25:16.929Z","date_updated":"2025-10-20T15:22:56.279Z","question":"Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?","answer":"At Chipta, I led a project creating a ticket scanning app, to scan and validate event entrance tickets, using the phone camera. I decided on using React Native, and guided a medior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and the related business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo-ing a scan, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send data about it to the backend over the websocket connection. Then the backend would broadcast this scan data to the other scan apps with open websocket connections, synchronizing the apps. Also, if an administrator would update the status of a visitor's ticket in the backend, it would also be broadcasted over the websockets.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store, under the name \\"Chipta\\". Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.\\n\\nChipta in the Google Play Store:\\nhttps://play.google.com/store/apps/details?id=com.chipta\\n\\nChipta in the Apple App Store:\\nhttps://apps.apple.com/us/app/chipta/id1156524548","title":"Full-stack app building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta, I led a project creating a ticket scanning app, to scan and validate event entrance tickets, using the phone camera. I decided on using React Native, and guided a medior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and the related business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo-ing a scan, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send data about it to the backend over the websocket connection. Then the backend would broadcast this scan data to the other scan apps with open websocket connections, synchronizing the apps. Also, if an administrator would update the status of a visitor's ticket in the backend, it would also be broadcasted over the websockets.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store, under the name \\"Chipta\\". Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.\\n\\nChipta in the Google Play Store:\\nhttps://play.google.com/store/apps/details?id=com.chipta\\n\\nChipta in the Apple App Store:\\nhttps://apps.apple.com/us/app/chipta/id1156524548","date_updated":"2025-10-20T15:22:56.279Z"}	\N	\N
1634	1688	application_questions	073c5b04-8c09-46d5-939a-1ed666898fe0	{"id":"073c5b04-8c09-46d5-939a-1ed666898fe0","sort":1,"date_created":"2025-10-20T12:33:01.867Z","date_updated":"2025-10-20T15:25:34.417Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At Chipta I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I even modified Django to work with an existing translation system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, nested routing (using drf-nested-routers), filtering (using django-filter), field-based filtering (using drf-flex-fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nTo create ticket PDFs, I used Django-WeasyPrint, which uses Weasyprint under the hood, and transforms a Django HTML template, including styles and images, to a PDF file.\\n\\nI used Python Fabric to build a comprehensive custom CI/CD pipeline to deploy the project to our servers.\\n\\nI used Selenium to write integration tests to automatically test our frontend.\\n\\nYou can sign up and create a ticketshop yourself at: https://chipta.com/","title":"Python backend building experience","profile":"0eeb942b-e35a-44e8-a37d-52b9cdb24309","source":"AuditOne"}	{"answer":"At Chipta I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I even modified Django to work with an existing translation system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, nested routing (using drf-nested-routers), filtering (using django-filter), field-based filtering (using drf-flex-fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nTo create ticket PDFs, I used Django-WeasyPrint, which uses Weasyprint under the hood, and transforms a Django HTML template, including styles and images, to a PDF file.\\n\\nI used Python Fabric to build a comprehensive custom CI/CD pipeline to deploy the project to our servers.\\n\\nI used Selenium to write integration tests to automatically test our frontend.\\n\\nYou can sign up and create a ticketshop yourself at: https://chipta.com/","date_updated":"2025-10-20T15:25:34.417Z"}	\N	\N
